function renderNumber(b) {
    b = Math.round(b);
    var a = "";
    if (b == 0) {
        return '<span class="text-h2">0</span>'
    }
    while (b > 0) {
        a = '<span class="text-h2">' + b % 10 + "</span>" + a;
        b = parseInt(b / 10);
        if (b > 0) {
            a = '<span class="char">\\</span>' + a
        }
    }
    return a
}

