function changeCounterPattern(b, a) {
    setTimeout(function() {
        b.interval = setInterval(function() {
            if (b.currentPattern.RemainTime <= 0) {
                clearInterval(b.interval);
                if (b.Patterns[b.currentIndex + 1]) {
                    b.DelayToStart = b.currentPattern.DelayToNextPattern;
                    b.currentPattern = b.Patterns[++b.currentIndex];
                    changeCounterPattern(b, a)
                }
            } else {
                b.CurrentCount++;
                $(a).closest(".text-stagger").find(".text-h2,.char").remove();
                var c = renderNumber(b.CurrentCount);
                $(c).insertAfter(a);
                b.currentPattern.RemainTime -= b.currentPattern.SecondPerUnit
            }
        }, b.currentPattern.SecondPerUnit * 1000)
    }, b.DelayToStart * 1000)
}
