function convertDataToArray(b) {
    var c = [];
    for (var d in b) {
        var a = {};
        $html = $('[name="' + d + '"]');
        var e = "TextValue";
        var k = "Text";
        if ($html.attr("type") == "number") {
            e = "NumberValue";
            k = "Number"
        }
        a.Code = d;
        a[e] = b[d];
        a.ValueType = k;
        c.push(a)
    }
    return c
}

function checkValues(b) {
    var a = {};
    for (var c in b) {
        $this = $('[name="' + c + '"]');
        switch (typeof b[c]) {
            case "string":
                if ($this.attr("error")) {
                    if (!b[c].trim()) {
                        a[c] = $this.attr("error")
                    }
                }
                if ($this.attr("type") == "number") {
                    if (($this.attr("min") && !b[c].trim()) || parseInt(b[c].trim()) < parseInt($this.attr("min"))) {
                        $this.val($this.attr("min"));
                        b[c] = $this.attr("min")
                    }
                }
                if ($this.attr("type") == "email") {
                    var d = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
                    if (!d.test(b[c].trim())) {
                        a[c] = "Xin vui lòng điền email đúng định dạng example@Gmail.com"
                    }
                }
                break;
            case "number":
                if (!b[c]) {
                    a[c] = $('[name="' + c + '"]').attr("error")
                }
                break
        }
    }
    return a
}

