function loadAll(a) {
    api.Send("Outlet/GetAll", {
        PageSize: 5000,
        CompanyCode: config.CompanyCode,
        query: "",
        Filters: "null" ,
        BrandCodes: [config.BrandCodes]
    }, function(g) {
        if (g) {
            apiData.markers = g.Result;
            for (var d in g.Result) {
                var b = g.Result[d].Location.split(",");
                g.Result[d].position = new google.maps.LatLng(b[0], b[1]);
                g.Result[d].positionT = b;
                for (var c in g.Result[d].Attributes) {
                    if (g.Result[d].Attributes[c].Code == "DessertCup") {
                        g.Result[d].OutletName = getName(g.Result[d].OutletAddress);
                        break;
                    }
                }
                for (var c in g.Result[d].Attributes) {
                    if (g.Result[d].Attributes[c].Code == "SellCoffeeMachine") {
                        if(g.Result[d].Attributes[c].NumberValue == "1.0") {
                            g.Result[d].icon = icons.phindien;
                            g.Result[d].SellCoffee = "Machine";
                        }                        
                        break;
                    } else if (g.Result[d].Attributes[c].Code == "SellCoffeeCapsule") {
                        if(g.Result[d].Attributes[c].NumberValue == "1.0") {
                           g.Result[d].icon = icons.viencafe;
                           g.Result[d].SellCoffee = "Capsule";
                        }                       
                        break;
                    }
                }
                addPoint(g.Result[d]);
            }
            markerCluster = MapCluster(map,markers);
            bIsLoad_All = true;
            ShowAllMarker();
            if (typeof a == "function") {
                a(g)
            }
        }
    })
}

