function renderOutletList(a) {
    api.Send("RequestForm/GetAll", {
        PageIndex: a,
        PageSize: 6,
        FormType: ["Quan", "NonQuan"],
        Status: ["Contacted"],
        CompanyCode: config.CompanyCode,
        Attributes: ["SecondaryCustomerName_Quan", "Phone_Quan", "SecondaryCustomerName_NonQuan", "Phone_NonQuan"],
        ThumbSize: "270",
        FullSize: "",
        BrandCode: config.BrandCodes
    }, function(d) {
        if (!d) {
            for (c = 1; c < 6; c++) {
                var f = $('<div class="content-w"><div>&nbsp;</div><div>&nbsp;</div><div>&nbsp;</div></div>');
                $(".partner2-listing .content").append(f)
            }
            return
        }
        d.Result.sort(function(h, g) {
            return h.No - g.No
        });
        var b = 1;
        for (var c in d.Result) {
            var f = $('<div class="content-w"><div>' + d.Result[c].No + "</div><div>" + (d.Result[c].SecondaryCustomerName_Quan || d.Result[c].SecondaryCustomerName_NonQuan) + "</div><div>" + (d.Result[c].Phone_Quan || d.Result[c].Phone_NonQuan) + "</div></div>");
            $(".partner2-listing .content").append(f);
            b++
        }
        if (b < 6) {
            for (c = b - 1; c < 6; c++) {
                var f = $('<div class="content-w"><div>&nbsp;</div><div>&nbsp;</div><div>&nbsp;</div></div>');
                $(".partner2-listing .content").append(f)
            }
        }
        try {
            $(".list-unstyled").paging(d.Total, {
                format: "< . (q -) nnnnn (- p) . >",
                perpage: 6,
                lapping: 0,
                page: a,
                onFormat: function(g) {
                    switch (g) {
                        case "block":
                            nclass = "";
                            if (a == this.value) {
                                nclass = "active"
                            }
                            return '<li><a href="?page=' + this.value + '" class="' + nclass + '">' + this.value + "</a></li>";
                        case "next":
                            if (a == this.value) {
                                return '<li><img src="img/icon/page-r.png"></li>'
                            } else {
                                return '<li><a href="?page=' + this.value + '"><img src="img/icon/page-r.png"></a></li>'
                            }
                        case "prev":
                            if (a == 1) {
                                return '<li><img src="img/icon/page-l.png"></li>'
                            } else {
                                return '<li><a href="?page=' + this.value + '"><img src="img/icon/page-l.png"></a></li>'
                            }
                        case "first":
                            return "";
                        case "last":
                            return "";
                        case "leap":
                            return "";
                        case "fill":
                            if (this.active) {
                                return "<li>...</li>"
                            }
                            return "";
                        case "left":
                            if (this.active) {
                                return '<li><a href="?page=' + this.value + '">' + this.value + "</a></li>"
                            }
                            return "";
                        case "right":
                            if (this.active) {
                                return '<li><a href="?page=' + this.value + '">' + this.value + "</a></li>"
                            }
                            return ""
                    }
                }
            })
        } catch (e) {
            console.log(e)
        }
    })
}

