function addYourLocationButton(g, k, i) {
    var l = document.createElement("div");
    var h = document.createElement("button");
    h.style.backgroundColor = "#fff";
    h.style.border = "none";
    h.style.outline = "none";
    h.style.width = "28px";
    h.style.height = "28px";
    h.style.borderRadius = "2px";
    h.style.boxShadow = "0 1px 4px rgba(0,0,0,0.3)";
    h.style.cursor = "pointer";
    h.style.marginRight = "10px";
    h.style.padding = "0";
    h.title = "Your Location";
    l.appendChild(h);
    var j = document.createElement("div");
    j.style.margin = "5px";
    j.style.width = "18px";
    j.style.height = "18px";
    j.style.backgroundImage = "url(img/mylocation-sprite-2x.png)";
    j.style.backgroundSize = "180px 18px";
    j.style.backgroundPosition = "0 0";
    j.style.backgroundRepeat = "no-repeat";
    h.appendChild(j);
    google.maps.event.addListener(g, "center_changed", function() {
        j.style["background-position"] = "0 0"
    });
    h.addEventListener("click", function() {
        var a = "0",
            b = setInterval(function() {
                a = a === "-18" ? "0" : "-18";
                j.style["background-position"] = a + "px 0"
            }, 500);
        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(function(d) {
                if(userLocation != null){
                    markers_mylocation[userLocation].setMap(null);
                    markers_mylocation.splice(userLocation,1);
                    userLocation = null;
                }
                var c = new google.maps.LatLng(d.coords.latitude, d.coords.longitude);
                g.setCenter(c);
                clearInterval(b);
                j.style["background-position"] = "-144px 0";
                k = new google.maps.Marker({
                    map: g,
                    animation: google.maps.Animation.DROP,
                    position: c,
                    icon: 'img/your-location.png'
                })
                userLocation = markers_mylocation.push(k) - 1;
                k.setPosition(c)
            })
        } else {
            clearInterval(b);
            j.style["background-position"] = "0 0"
        };
    });
    l.index = 1;
    if (i && i.geolocation) {
        g.controls[(i.geolocation.position || google.maps.ControlPosition.RIGHT_BOTTOM)].push(l)
    } else {
        g.controls[google.maps.ControlPosition.RIGHT_BOTTOM].push(l)
        
    }
}

