function addPoint(e,type, d) {
    if (firstLoadMap) {
        return
    }
    var f = new google.maps.Marker({
        position: e.position,
        icon: e.icon || icons.cafe,
        map: map,
        id: e.OutletCode,
        SellCoffee : e.SellCoffee
    });
    if(type == CONSTANT_PHINDIEN){
        markers_phindien.push(f);
    } else if(type == CONSTANT_VIENCAPHE) {
        markers_phindien_and_viencafe.push(f);
    }
    else {
        markers.push(f);
    }
    f.addListener("click", function() {
        f.setAnimation(null);
        infowindow.setContent(setInfoContent(e));
        infowindow.open(map, this)
    });
    if (typeof d == "function") {
        d(f)
    }    
}

function setMapOnAll(c) {
    for (var d = 0; d < markers.length; d++) {
        markers[d].setMap(c)
    }
    for (var index = 0; index < markers_phindien_and_viencafe.length; index++) {
        markers_phindien_and_viencafe[index].setMap(c)
    }

    for (var index = 0; index < markers_phindien.length; index++) {
        markers_phindien[index].setMap(c)
    }
}

function setMapCenter(h, f, g) {
    var center = new google.maps.LatLng(parseFloat(h), parseFloat(f));
    map.panTo(center);
    if (g) {
        if(typeof markerCluster_viencafe_phindien != "undefined")
            markerCluster_viencafe_phindien.clearMarkers();
        if(typeof markerCluster_phindien != "undefined")
            markerCluster_phindien.clearMarkers();
        if(typeof markerCluster != "undefined")
            markerCluster.clearMarkers();
        for (var i = 0; i < markers.length; i++) {
            markers[i].setVisible(false);
        }
        for (var e in markers) {
            if (markers[e].id == g) {
                index_change_icon = e;
                map.setZoom(21);
                var tabSearch = parseInt($('input[name=c_type]:checked', '#list_choose_option').val());
                switch(tabSearch){
                    case 1:
                        markers[e].icon = icons.phindien;
                        markers[e].setVisible(true);
                        markerCluster_phindien.addMarker(markers[e]);
                        break;
                    case 2:
                        markers[e].icon = icons.viencafe;
                        markers[e].setVisible(true);
                        markerCluster_viencafe_phindien.addMarker(markers[e]);
                        break;
                    default:
                        if(markers[e].SellCoffee != "undefined"){
                            if(markers[e].SellCoffee == "Machine"){
                                markers[e].icon = icons.phindien;
                            }
                            else if(markers[e].SellCoffee == "Capsule"){
                                markers[e].icon = icons.viencafe;
                            }
                        }
                        markers[e].setVisible(true);
                        markerCluster.addMarker(markers[e]);
                        break;
                }
                markers[e].setAnimation(google.maps.Animation.BOUNCE);
                break
            }
        }
    }
}

function clearMarkers() {
    setMapOnAll(null)
}

function showMarkers() {
    setMapOnAll(map)
}

function deleteMarkers() {
    clearMarkers();
    markers = [];
    markers_phindien = [];
    // markers_viencafe = [];
    markers_phindien_and_viencafe = [];
}
