    $("#search-branch").keyup(function(b) {
        if(typeof info_alert_marker != "undefined"){
            info_alert_marker.setMap(null);
            var cur_tab = parseInt($('input[name=c_type]:checked', '#list_choose_option').val());
            if(cur_tab == info_alert_marker.current_tab){
                info_alert_marker.flag_close = 1;
            }
        }

        var a = $(this).val().trim().toLowerCase();
        var e = $(this).next();
        if (a.length >= 2) {
            e.removeClass("fa-search").addClass("fa-spinner fa-spin");
            if (f) {
                clearTimeout(f);
                f = null
            }
            f = setTimeout(function() {
                if (c[a] !== undefined) {
                    a = c[a];
                    //setMapCenter(toado[a][0], toado[a][1],0);
                    var center = new google.maps.LatLng(toado[a][0], toado[a][1]);
                    map.setZoom(17);
                    map.panTo(center);
                }
                setTimeout(function() {
                    var code = (b.keyCode ? b.keyCode : b.which);
                    if (code == 13) {
                        var markers_check = [];
                        var cur_tab_check = parseInt($('input[name=c_type]:checked', '#list_choose_option').val());
                        switch(cur_tab_check){
                            case 1:
                                markers_check = markers_phindien;
                                break;
                            case 2:
                                markers_check = markers_phindien_and_viencafe;
                                break;
                            default:
                                markers_check = markers;
                                break;
                        }
                        var i_count_m = 0;
                        var count_marker = markers_check.length;
                        var b_flag = false;
                        for(i_count_m = 0; i_count_m < count_marker; i_count_m++){
                            if( map.getBounds().contains(markers_check[i_count_m].getPosition()) && markers_check[i_count_m].getVisible() == true){
                                b_flag = true;
                                break;
                            }
                        }
                        if(b_flag == false){

                            CURRENT_TAB = parseInt($('input[name=c_type]:checked', '#list_choose_option').val());
                            info_alert_marker = new google.maps.Marker({
                                position: center,
                                map: map
                            });

                            info_alert_marker.flag_close = 0;
                            info_alert_marker.current_tab = parseInt($('input[name=c_type]:checked', '#list_choose_option').val());

                            info_alert_marker.addListener("click", function() {
                                info_alert_marker.setAnimation(null);
                                infowindow.setContent(setInfoContent_alert("Khu vực này không có quán bạn tìm, vui lòng thu nhỏ để xem thêm."));
                                infowindow.open(map, this);
                            });
                            new google.maps.event.trigger(info_alert_marker, 'click' );
                        }
                    }
                },1000);
                searchAPI(a, function(l) {
                    if (l) {
                        $(".search-wrap").fadeIn(200);
                        $(".search-wrap .search-item").fadeOut(0);
                        for (var h in l.Result) {
                            var findresult = $.grep(apiData.markers, function(e){ return e.OutletCode == l.Result[h].OutletCode; });
                            
                            if ($('.search-item[map-id="' + l.Result[h].OutletCode + '"]').length) {
                                $('.search-item[map-id="' + l.Result[h].OutletCode + '"]').fadeIn(0)
                            } else {
                                if (markerCluster) {
                                  markerCluster.clearMarkers();
                                }
                                apiData.markers.push(l.Result);
                                for (var j in l.Result) {
                                    var k = l.Result[j].Location.split(",");
                                    l.Result[j].position = new google.maps.LatLng(k[0], k[1]);
                                    l.Result[j].positionT = k;
                                    if (findresult.length == 0) {
                                        addPoint(l.Result[j]);
                                    }
                                    var m = '<div map-id="' + l.Result[j].OutletCode + '" onclick="setMapCenter(' + l.Result[j].positionT + "," + l.Result[j].OutletCode + '); offSearch();" class="search-item"><strong>' + l.Result[j].OutletName + "</strong><br />" + l.Result[j].OutletAddress + "</div>";
                                    $(".search-wrap .search-value").append(m);
                                    $('.search-item[map-id="' + l.Result[h].OutletCode + '"]').fadeIn(0)
                                }
                                markerCluster = MapCluster(map, markers);
                            }
                        }
                        $(".search-wrap").fadeIn(200)
                    } else {
                        $(".search-wrap").fadeOut(200)
                    }
                    e.removeClass("fa-spinner fa-spin").addClass("fa-times");
                    e.bind("click", function() {
                        e.removeClass("fa-spinner fa-spin fa-times").addClass("fa-search");
                        $(".input-search #search-branch").val("");
                        $(".input-search .search-wrap").hide()
                    })
                })
            }, 1000)
        } else {
            if (a.length == 0) {
                $(".search-wrap").fadeOut(200);
                e.removeClass("fa-spinner fa-spin fa-times").addClass("fa-search");
                e.unbind("click")
            }
        }
    })
